"""
Módulo de recursos embebidos para Daily Log Application.
Contiene imágenes y assets en formato base64 para evitar dependencias de archivos externos.
"""

import base64
from io import BytesIO
from PIL import Image

# Imagen de fondo del login (500x350 JPG)
LOGIN_BG_BASE64 = """"""

def get_login_background():
    """
    Retorna la imagen de fondo del login como PIL.Image.
    
    Returns:
        PIL.Image: Imagen de fondo (500x350)
    """
    try:
        image_data = base64.b64decode(LOGIN_BG_BASE64)
        return Image.open(BytesIO(image_data))
    except Exception as e:
        print(f"[ERROR] No se pudo cargar imagen de fondo: {e}")
        return None

def get_login_background_resized(size=(500, 350)):
    """
    Retorna la imagen de fondo redimensionada.
    
    Args:
        size (tuple): Tamaño (ancho, alto)
    
    Returns:
        PIL.Image: Imagen redimensionada
    """
    img = get_login_background()
    if img:
        return img.resize(size, Image.Resampling.LANCZOS)
    return None

